import React from "react";

//props:character.name, member.name
class StartLog extends React.Component{
    constructor(props){
        super(props);
        this.state={phase:0}; 
        this.countClick = this.countClick.bind(this);
    }

    countClick(){
        this.setState({"phase":this.state.phase+1});
    }

    render(){
        return(
            <div>
                <h1>StartLogです</h1>
            </div>
        )
    }
}

export default StartLog;
